const js = require('@eslint/js');
const eslintConfigPrettier = require('eslint-config-prettier');
const globals = require('globals');

module.exports = [
  {
    ignores: ['site/_site/**/*'],
  },
  js.configs.recommended,
  eslintConfigPrettier,
  {
    files: [
      'packages/**/*.js',
      'example-cli-usage/**/*.js',
      'util/**/*.js',
      '.prettierrc.js',
      'eslint.config.js',
      'site/*.js',
    ],
    languageOptions: {
      ecmaVersion: 2020,
      sourceType: 'commonjs',
      globals: {
        ...globals.node,
      },
    },
    rules: {
      curly: 'error',
      'dot-notation': 'error',
      eqeqeq: 'error',
      'new-cap': 'error',
      'no-alert': 'error',
      'no-caller': 'error',
      'no-eval': 'error',
      'no-labels': 'error',
      'no-lonely-if': 'error',
      'no-new': 'error',
      'no-proto': 'error',
      'no-return-assign': 'error',
      'no-self-compare': 'error',
      'no-shadow': 'error',
      'no-useless-call': 'error',
      'no-var': 'error',
      'no-void': 'error',
      'no-warning-comments': 'error',
      radix: 'error',
      yoda: 'error',
    },
  },
  {
    files: ['packages/**/*.mjs', 'util/**/*.mjs', 'site/util/**/*.mjs'],
    languageOptions: {
      sourceType: 'module',
      ecmaVersion: 2021,
      globals: {
        ...globals.node,
      },
    },
  },
  {
    files: ['site/src/*.js'],
    languageOptions: {
      globals: {
        ...globals.browser,
      },
    },
  },
];

{
  "name": "cssnano-core",
  "private": true,
  "scripts": {
    "lint": "pnpm types && eslint . --cache",
    "fixlint": "prettier --write . && pnpm lint -- --fix",
    "build:integration": "node ./util/buildFrameworks.mjs",
    "pretest": "pnpm lint",
    "test:only": "node --test",
    "test:coverage": "c8 pnpm test:only",
    "test": "pnpm test:coverage",
    "types": "tsc -b",
    "all-publish": "pnpm changeset publish"
  },
  "workspaces": [
    "./packages/*"
  ],
  "engines": {
    "node": "^18 || ^20 || >=22"
  },
  "devDependencies": {
    "@changesets/cli": "^2.27.11",
    "@types/node": "^22.10.2",
    "c8": "^10.1.3",
    "eslint": "^9.17.0",
    "eslint-config-prettier": "^9.1.0",
    "globals": "^15.14.0",
    "postcss": "^8.4.49",
    "postcss-font-magician": "^4.0.0",
    "prettier": "^3.4.2",
    "typescript": "~5.7.2"
  },
  "browserslist": {
    "production": [
      "IE 11 and last 2 versions"
    ]
  }
}
